import TopBarNav from '../components/TopBarNavigator'
import Head from 'next/head'
import chungus from '../assets/chungus.png'
import Card from '../components/Card'
import meEggs from '../assets/meWithEggs.jpg'
import ImageCard from "../components/ImageCard"

export default class Gallery extends React.Component {
    constructor(props){
        super(props);
        this.state={
            hover: false,
        }
    }

    render() {
        var picStyle

        return (
            
            <div className='container'>
                
                <TopBarNav currentPage = {3} />
                <div style={{flex: 1, display:'flex', flexDirection: 'row', margin:0, padding: 0, border: 0}}>
                    <div className='galleryContent'>
                        <ImageCard source={meEggs} height={400} width={600}>

                        </ImageCard>
                        <Card width="auto" height="auto">
                            
                        </Card>
                    </div>
                </div>
                
            </div>
        );
    }
}
